--------------------------------------------------------
--  DDL for Package Body LIST_PLACES
--------------------------------------------------------

  CREATE OR REPLACE NONEDITIONABLE PACKAGE BODY "ORACLEJ"."LIST_PLACES" AS 

  /* TODO enter package declarations (types, exceptions, methods etc) here */ 
    PROCEDURE LIST_DEP_NAME (c_dep_name OUT SYS_REFCURSOR)
    IS
    BEGIN
    OPEN c_dep_name FOR SELECT DEPARTMENTS.DEP_NAME FROM DEPARTMENTS;
    END;
    
    PROCEDURE LIST_PROV_NAME (c_prov_name OUT SYS_REFCURSOR, dep_cod IN VARCHAR)
    IS
    BEGIN
    OPEN c_prov_name FOR SELECT PROVINCES.PROV_NAME FROM PROVINCES WHERE PROVINCES.PROV_DEPCOD = dep_cod;
    END;
    
    PROCEDURE LIST_DIS_NAME (c_dis_name OUT SYS_REFCURSOR, prov_cod IN VARCHAR)
    IS
    BEGIN
    OPEN c_dis_name FOR SELECT DISTRICTS.DIS_NAME FROM DISTRICTS WHERE DISTRICTS.DIS_PROVCOD = prov_cod;
    END;


END LIST_PLACES;

